// file to export random array of fruits
function foods () {
    const fruitsArr = ["üçà","üçâ","üçä","üçç","üçá","üçå"];

    // create array of random fruits
    let foodArr = new Array(15).fill(null);
    foodArr = foodArr.map(function(n) {
        return fruitsArr[Math.floor(Math.random() * fruitsArr.length)];
    });
    console.log(foodArr);
    return foodArr;
}

export default foods;
